import React, { Fragment } from 'react';


function Row({ rowRolls }) {

    console.log(`printing row with ${rowRolls.length} columns`)

    let content = []
    for ([index, value] of rowRolls.entries()) {
        content.push(<td><Die key={index} roll={value} /></td>)
    }
    return (
        <div>
            {content}
        </div>

    )
}


export default Board
